    // 初始化状态
    state = {
        name: "yaoyao",
        age: 20
    }
    changeAge = () => {
        const age=this.state.age;
        this.setState = ({
            age:30
        })
        console.log(age)
    }
    render() {
        return (<div>
            <h1 > {this.state.name}:{this.state.age} </h1>
            <button onClick={this.changeAge}>    点击修改年龄</button>
        </div>)
    }
}
export default login;
